INSERT INTO `v1_0011c07719c837deb707bea935534f9fcd2fa2910e256da1f68049bfd32582c8` VALUES (1, "キャルちゃんも冒険、楽しんでますか？\n調味料ならたっぷりありますし、新種の\n魔物を見かけたら教えてくださいね♪", 0, 11, 105811, 1, 0, 0, 1200120005, 10, 20012);
